const FeaturesCard = ({title,desc}) => {
    const handleMouseOn=()=>{
        document.getElementById
    }
  return (
    <div className='featuresCard' onMouseOver={handleMouseOn}>
        <div className='face1' id={title}>
            <h1>{title}</h1>
        </div>
        <div className='face2'>
            <p>{desc}</p>
        </div>
    </div>
  )
}

export default FeaturesCard
